--
-- Table structure for table `sys_menu`
--

DROP TABLE IF EXISTS `sys_menu`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `sys_menu` (
  `menu_id` bigint NOT NULL COMMENT '主键',
  `menu_parent_id` bigint NOT NULL COMMENT '父id，顶级节点的父id是-1',
  `menu_pids` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '父id集合，中括号包住，逗号分隔',
  `menu_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '菜单的名称',
  `menu_code` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '菜单的编码',
  `app_code` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '应用编码',
  `menu_sort` decimal(10,2) NOT NULL DEFAULT '100.00' COMMENT '排序',
  `status_flag` tinyint NOT NULL DEFAULT '1' COMMENT '状态：1-启用，2-禁用',
  `remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '备注',
  `layui_path` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '菜单的路径，适用于layui-beetl版本',
  `layui_icon` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '菜单的图标，适用于layui-beetl版本',
  `layui_visible` char(1) COLLATE utf8_bin DEFAULT 'Y' COMMENT '是否可见(layui版用)：Y-是，N-否',
  `antdv_router` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '路由地址，浏览器显示的URL，例如/menu，适用于antdvue版本',
